import React, {Component} from 'react';
import {Route, Switch} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import HomePage from './webpages/HomePage'

class App extends Component{
  render() {
    const App = () => (
      <div>
        <Switch>
          <Route exact path='/' component={HomePage}/>
        </Switch>
      </div>
    )
    return (
      <Switch>
        <App/>
      </Switch>  
    );
  }
}

export default App;
